import "./Navbar.css";
function Navbar(){
    return(
        <div>
            <h1 className="task">Tasks</h1>
            <nav>
                <li>Incoming</li>
                <li>Today</li>
                <li>Canlendar</li>
            </nav>
        </div>
    )
}
export default Navbar;
